// Use Spark SQL csv reader to download & read the public GDELT dataset off s3 (for January 2016)
val rawGdeltDataset = spark.read
    .option("header", false)
    .option("delimiter", "\t")
    .csv("s3://gdelt-open-data/events/200601.csv")

// Register the dataset as a temp view so we can use the SQL interpreter on it for easy queries
rawGdeltDataset.createOrReplaceTempView("rawGdeltDataset")

// Show the schema of the table so we know what we're dealing with (lots of unnamed columns)
rawGdeltDataset.printSchema()
